import React from 'react'

export default function FormPlaylist() {
  return (
    <div>
         <div>
            {/* Header */}
            <header className='header'>
                <div className='pl-[235px] relative mb-8'>
                    <img src="https://static1.makeuseofimages.com/wordpress/wp-content/uploads/2019/04/spotify-background-music.jpg" alt="" className='h-96 w-full object-cover opacity-70' />
                    <p className='absolute top-[50%] -translate-y-1/2 font-CircularBold text-6xl left-96 tracking-widest'>Playlists</p>
                </div>
            </header>
            {/* Header */}
        </div>
    </div>
  )
}
